    // const temp3 = 100000
    return (
        <Card variant="outlined">
            <Typography variant="subtitle1" sx={{fontWeight : 'bold'}}>{title}</Typography>
            <Typography variant="p">{company}</Typography>
            <br />
            <Typography variant="p">{salary}</Typography>
        </Card>
    )    
}
